export const GetInvitedsByIdEvent = (idIvent) => {
  axios
    .get(`${baseURL}Category/GetIdSubCategory/${nameSubCategory}`)
    .then(function (response) {
      // handle success
      console.log(response);
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
};

